define({"topics" : [{"title":"Rules for mapping custom fields","shortdesc":"\n                        <p class=\"shortdesc\">Mapping is driven by field names. Fields in <span class=\"ph\">Quality Center</span> and     <span class=\"ph\">TestArchitect</span> are mapped to each other automatically when a),    their names are identical, b), their data types are compatible, and c),\n                           the TestArchitect     <span class=\"ph uicontrol\">Apply To</span> entity is matched properly with the <span class=\"ph\">Quality Center</span>    <span class=\"ph uicontrol\">Project</span> entity. When uploading from <span class=\"ph\">TestArchitect</span> to <span class=\"ph\">Quality Center</span>, values from<span class=\"ph\">TestArchitect</span> user-defined fields are loaded into their corresponding    fields in <span class=\"ph\">Quality Center</span>. Likewise, values from <span class=\"ph\">Quality Center</span> custom fields are loaded into the corresponding <span class=\"ph\">TestArchitect</span> user-defined fields when importing tests from <span class=\"ph\">Quality Center</span> to <span class=\"ph\">TestArchitect</span>.   \n                        </p>\n                     ","id":"QC_creating_custom_field_rules","href":"TA_Help\/Topics\/Integration_QC_creating_custom_field_rules.html","menu": {"hasChildren":false,},"tocID":"QC_creating_custom_field_rules-d46e24218","topics":[]},{"title":"Custom fields: Example #1","shortdesc":"\n                        <p class=\"shortdesc\">This example demonstrates the steps involved in mapping a custom field in <span class=\"ph\">TestArchitect</span> to a custom field in the <span class=\"ph\">Quality Center</span>     <span class=\"ph uicontrol\">TEST</span> table.\n                        </p>\n                     ","id":"QC_creating_custom_field_ex_1","href":"TA_Help\/Topics\/Integration_QC_creating_custom_field_ex_1.html","menu": {"hasChildren":false,},"tocID":"QC_creating_custom_field_ex_1-d46e24270","topics":[]},{"title":"Custom fields: Example #2","shortdesc":"\n                        <p class=\"shortdesc\">This second example explores the steps involved in mapping to custom fields in the <span class=\"ph\">Quality Center</span>   <span class=\"ph uicontrol\">RUN</span> table.\n                        </p>\n                     ","id":"QC_creating_custom_field_ex_2","href":"TA_Help\/Topics\/Integration_QC_creating_custom_field_ex_2.html","menu": {"hasChildren":false,},"tocID":"QC_creating_custom_field_ex_2-d46e24290","topics":[]},{"title":"Mapping test objective to QC","shortdesc":"\n                        <p class=\"shortdesc\">By default, the test objectives that may be assigned to <span class=\"ph\">TestArchitect</span> test modules and test cases are not carried over to     <span class=\"ph\">Quality Center</span> tests. You can remedy that, however, by creating a special     <span class=\"ph uicontrol\">test objective</span> custom field.\n                        </p>\n                     ","id":"QC_creating_test_objective_field","href":"TA_Help\/Topics\/Integration_QC_creating_test_objective_field.html","menu": {"hasChildren":false,},"tocID":"QC_creating_test_objective_field-d46e24307","topics":[]}]});